import { IConClose } from "@components";
import styled from "styled-components";

export const ComponentHistoryDetail = () => {
    return (
        <StyledContainer>
            <div className="content">
                <div className="close">
                    <IConClose />
                </div>
            </div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    height: 100vh;
    width: 100%;
    position: fixed;
    top: 0;
    display: flex;
    /* text-align: center; */
    align-items: center;
    justify-content: center;
    max-width: 480px;
    background: rgba(0, 0, 0, 0.5);
    .content {
        width: 90%;
        padding: 28px;
        background-color: #fff;
        position: relative;
        .close {
            position: absolute;
            top: 28px;
            right: 28px;
        }
    }
`;
